import FolderList from "components/FolderList/FolderList";
// import CardList from "components/FolderPage/CardList/CardList";
import SearchInput from "components/FolderPage/SearchInput/SearchInput";

function Main({ loadingError, search, folderListInfo, handleSearchChange }) {
  return (
    <>
      {folderListInfo && <FolderList links={folderListInfo} />}
      <SearchInput
        loadingError={loadingError}
        search={search}
        handleSearchChange={handleSearchChange}
      />
      {/* <CardList /> */}
    </>
  );
}

export default Main;
